import * as React from 'react';
import * as ReactDOM from 'react-dom';



import './index.css';

const store = createStore<StoreState>(enthusiasm, {
  enthusiasmLevel: 1,
  languageName: 'TypeScript',
});

ReactDOM.render(

  document.getElementById('root') as HTMLElement
);
